import React from "react";
import GoalDetails from "../GoalDetail/GoalDetail";

import {
  BrowserRouter as Router
  // Route,
  // Redirect,
  // Switch
} from "react-router-dom";
// CSS
import "./GoalList.css";

const GoalsList = props => {
  // console.log(props.userGoals);
  const showGoalDetailHandler = () => {
    console.log("Here are the goal details");
  };
  return (
    <div className="goals-list">
      <p>User's current goals</p>
      <ul>
        {props.userGoals.map(goal => {
          return (
              <GoalDetails key={goal.id} />
          );
        })}
      </ul>
    </div>
  );
};

export default GoalsList;
